      <Swiper
         class="_swiper d-md-none py-2"
         :slides-per-view="slidesPerView"
         :space-between="spaceBetween"
         :loop="false"
      >
         <SwiperSlide 
            v-for="(slide, index) in dataSlide" 
            :key="index"
         >
            <div class="card">
               <a
                  href=""
                  @click.prevent="saveSlideNameAndNavigate(slide.name)"
                  class="slide-link text-white"
               >
                  <img :src="slide.image" class="card-img-top" alt="">
                  <div class="card-body">
                     <div class="card-body-title">
                        <h5 class="card-title">{{slide.name}}</h5>
                        <p class="card-text">da {{slide.price}}</p>
                     </div>
                     <button class="btn">
                        <i class="fa-solid fa-chevron-right"></i>
                     </button>
                  </div>
               </a>
            </div>
         </SwiperSlide>
      </Swiper>

      <!-- desktop -->
      <div class="d-none d-md-flex justify-content-center">
         <div 
            class="card p-0"
            v-for="(slide, index) in dataSlide"
            :key="index"
         >
            <img :src="slide.image" class="card-img-top" alt="" />

            <div class="card-body d-none d-md-flex">
               <div class="card-body-title">
                  <h5 class="card-title">{{slide.name}}</h5>
                  <p class="card-text">da {{slide.price}}</p>
               </div>
               <button class="btn">
                  <i class="fa-solid fa-chevron-right"></i>
               </button>

               <div class="bg_hidden">
                  <p>7 notti / 8 giorni</p>
               </div>
            </div>
         </div>
      </div>

